INSERT INTO `wgg_web_cases` VALUES ('7', '-1', '1', '56度C代表着安全的温度', '56度C代表着安全的温度。非常时期，家里衣物、餐具都要高温消毒，家里空气也要消毒除菌。2月26日，海尔空调行业首个发布了56度C除菌空调，实现“智慧自清洁，只吹干净风”的效果。仅半个月时间，56度C除菌成为行业热词，并引发行业跟进。', '通过对比发现，海尔56度C除菌空调具备独有的3大优势：\r\n\r\n1、唯一一个蒸发器翅片与盘管同时达到56℃以上除菌，实测最高超过60℃，而行业只能做到蒸发器盘管的56℃。\r\n\r\n2、唯一一个蒸发器56℃以上温度持续时间超过30分钟，最高达到60分钟。按照官方说法：温度达到56℃、持续30分钟，可以有效灭活新型冠状病毒。\r\n\r\n3、唯一一个拥有海外专利授权，目前除菌自清洁已获得欧盟、日本、俄罗斯等海外多个国家和地区的专利授权。\r\n\r\n通过以上3大优势，海尔56度C除菌空调让用户真正享受到健康呼吸。在3月13日19:00上线的56度C除菌空调嗨购盛典中，海尔空调线上为用户现场演示56度C、30分钟以上的空调除菌全过程。', '/uploads/20200325/9e16d0ab27d6983fbd70fdd8cd37f394.png', '235', '1584362554', '1585117763', '1585117763', '56度C代表着安全的温度', null, null, '0');
INSERT INTO `wgg_web_cases` VALUES ('8', '-1', '3', '佛山招商置地：食堂开启动“无人结算”智能时代', '戈子科技进驻佛山招商置地广场，将食堂打造成智慧餐厅，把视觉智能结算台带入食堂，开启视觉智能无人结算时代，打造温馨舒适的员工用餐环境！', '<p>戈子科技进驻佛山招商置地广场，将食堂打造成智慧餐厅，把视觉智能结算台带入食堂，开启视觉智能无人结算时代，打造温馨舒适的员工用餐环境！</p><p><img src=\"https://www.wggai.com/bikibb/news/news1/1.jpg\" alt=\"img\"></p><p>用餐者可根据自己喜好自由选取在餐盘中，最后统一在出口的结算台上自动扫描餐盘价格，然后刷卡、支付宝微信多种支付方式付款，整个过程实施“无人结算”。整个饭堂，整洁有序，在结算环节快速，高效，准确无误，大大节约了员工的就餐时间。同时，还使用了公众号、小程序在线订餐、会员管理等服务，员工可以提前订餐，更加人性化、个性化！</p><p><img src=\"https://www.wggai.com/bikibb/news/news1/2.jpg\" alt=\"img\"></p><p>许多员工都兴奋又好奇，感叹科技的进步，同时感叹公司的形象越来越好！就餐者可以选择刷卡、支付宝微信等多种支付方式，方便快捷！在新食堂中，戈子视觉结算台黑色的外观为食堂注入了科技感，食堂的整体形象大大提升。</p><p><img src=\"https://www.wggai.com/bikibb/news/news1/3.jpg\" alt=\"img\"></p>', '/uploads/20200330/44d81842da5f474ae2aff4d9cb983ad2.jpg', '241', '1584362658', '1588229489', '1588229489', '无人结算', null, null, '0');
INSERT INTO `wgg_web_cases` VALUES ('9', '10', '1', '腾讯无奈向苹果低头，阿里突然决定助推华为，向美巨头发起反击', '随着移动互联网的不断发展，最近这几年中国的移动互联网市场也发展得极为迅猛，在中国还诞生了不少的移动互联网巨头公司，像腾讯、阿里巴巴、华为等企业都是中国家喻户晓的企业，而这些巨头企业的不断发展也给我们的生活带来了很大的便利', '下文转载自作者：小勇的科技世界\r\n\r\n点击关注，每天精彩不断！\r\n\r\n导读：腾讯无奈向苹果低头，阿里突然决定助推华为，向美巨头发起反击！\r\n\r\n随着移动互联网的不断发展，最近这几年中国的移动互联网市场也发展得极为迅猛，在中国还诞生了不少的移动互联网巨头公司，像腾讯、阿里巴巴、华为等企业都是中国家喻户晓的企业，而这些巨头企业的不断发展也给我们的生活带来了很大的便利，同时也极大地促进了我国经济的发展；但随着中国科技企业的不断发展和崛起，也让不少国外企业开始担心起中国企业的挑战起来，其中就包括美国的一些科技巨头企业！', '/uploads/20200316/9e16d0ab27d6983fbd70fdd8cd37f394.png', '234263', '1584362715', '1585540716', '1585540716', '腾讯无奈向苹果低头', null, null, '0');
