INSERT INTO `wgg_web_cases` VALUES ('11', '-1', '1', '格力，掌握核心科技，食堂也不例外！', '4月22日，格力工厂热闹非凡，近一个多月精心筹备的“格力馨雅餐厅”，在众人期待中揭开神秘面纱，正式开业。新餐厅不仅有新美食，还有新的食堂黑科技戈子智能结算台新上线！！', '<p>4月22日，格力工厂热闹非凡，近一个多月精心筹备的“格力馨雅餐厅”，在众人期待中揭开神秘面纱，正式开业。新餐厅不仅有新美食，还有新的食堂黑科技戈子智能结算台新上线！！</p><p><img src=\"https://www.wggai.com/bikibb/news/news3/1.jpg\" alt=\"img\"></p><p>餐厅还特别增设了超市区、西点区和饮料区，水果、面包、蛋糕种类繁多，为员工就餐提供了更多新选择；同时，智能化收银服务已上线，大家只要将选好的菜品盘放到戈子视觉结算台上，即可完成智能结算自助买单。</p><p><img src=\"https://www.wggai.com/bikibb/news/news3/2.jpg\" alt=\"img\"></p><p>戈子智能视觉结算台备受员工们的关注，作为食堂的新成员，给食堂的颜值贡献了不少力量！大家纷纷来尝鲜，由于戈子结算台操作简单，设计人性化，聪明的格力员工马上就学会了如何使用，纷纷竖起了大拇指！</p><p><img src=\"https://www.wggai.com/bikibb/news/news3/3.jpg\" alt=\"img\"></p>', '/uploads/20200330/55ec8af10a1cfb5db48ad2562888664d.bmp', '5665', '1585117735', '1588229498', '1588229498', '智能结算台', null, null, '0');
INSERT INTO `wgg_web_cases` VALUES ('12', null, '1', '华南理工大学智慧食堂上线啦', ' 南理工大学地处广州，是直属教育部的全国重点大学，校园分为五山校区、大学城校区和广州国际校区，是首届“全国文明校园”获得单位。为全面推动高校学生膳食管理标准化、 规范化、信息化的新一代服务平台，各大高校纷纷启动智慧食堂计划。', '<p>华南理工大学地处广州，是直<span style=\"color: rgb(0, 0, 0); font-size: 11pt;\">属教育部的全国重点大学，校园分</span><span style=\"color: rgb(0, 0, 0); font-size: 11pt;\">为五山校区、大学城校区和广州国</span><span style=\"color: rgb(0, 0, 0); font-size: 11pt;\">际校区，是首届“全国文明校园”</span><span style=\"color: rgb(0, 0, 0); font-size: 11pt;\">获得单位。</span><span style=\"color: rgb(0, 0, 0); font-size: 11pt;\">为全面推动高校学生膳食管理</span><span style=\"color: rgb(0, 0, 0); font-size: 11pt;\">标准化、 规范化、信息化的新一代</span><span style=\"color: rgb(0, 0, 0); font-size: 11pt;\">服务平台，各大高校纷纷启动智慧</span><span style=\"color: rgb(0, 0, 0); font-size: 11pt;\">食堂计划，实现校园食堂精准售卖</span><span style=\"color: rgb(0, 0, 0); font-size: 11pt;\">、在线点餐、智能配送。其中华南</span><span style=\"color: rgb(0, 0, 0); font-size: 11pt;\">理工大学的3个校区分别体验了戈</span><span style=\"color: rgb(0, 0, 0); font-size: 11pt;\">子科技三种不同的智慧食堂模式。&nbsp;</span></p>', '/uploads/20200520/244138e27bc8d56e2f380acb8b3a64e9.png', '53', '1585649299', '1589955199', null, '智慧食堂', '', '', '0');
INSERT INTO `wgg_web_cases` VALUES ('13', null, '1', 'OPPO集团的时尚智慧餐厅', '时尚智慧餐厅、上线后就餐人数增加，时尚智慧餐厅、上线后就餐人数增加，时尚智慧餐厅、上线后就餐人数增加，时尚智慧餐厅、上线后就餐人数增加，时尚智慧餐厅、上线后就餐人数增加', '<p><br /></p><section powered-by=\"xiumi.us\" style=\"margin:0px;padding:0px 5px;max-width:100%;box-sizing:border-box;color:#333333;font-family:-apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif;font-size:16px;text-align:justify;white-space:normal;background-color:#FFFFFF;line-height:1.8;letter-spacing:1px;overflow-wrap:break-word !important;\"><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;box-sizing:border-box;clear:both;min-height:1em;\">“公司好不好，食堂见分晓。”企业食堂界的风向标，当属科技公司、互联网大厂的食堂。<span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box;overflow-wrap:break-word !important;font-size:15px;\"></span></p><p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;box-sizing:border-box;clear:both;min-height:1em;\"><br /></p><p>这些公司在保障员工福利方面，与国际接轨，特别注重从最基础的饮食开始，用美食给员工“洗胃清脑”，让他们在美味里“迷失”自我后，就连加班都美滋滋的。</p><p><br /></p><p>不过大厂成为“网.红”食堂的门槛已经越提越高，仅有国内国际美食让全网流口水还不够，品类够不够时尚，环境够不够无敌，黑科技够不够给力</p><p><br /></p></section><p><img src=\"/uploads/20200511/eddca3818ad71a2f7e2f189fec29c5fb.jpg\" alt=\"oppo网红食堂\" width=\"500\" height=\"333\" title=\"\" align=\"left\" style=\"text-align:center;\" /></p><p>&nbsp;&nbsp;<img src=\"/uploads/20200511/8298e7b31e5e3204f6493bbdf1cd7ad9.jpg\" alt=\"\" width=\"500\" height=\"334\" title=\"\" align=\"\" /></p>', '/uploads/20200520/37eae5f22bb1a814df103affe90ea882.png', '52', '1585649415', '1589955176', null, '', '', '', '0');
INSERT INTO `wgg_web_cases` VALUES ('14', null, '1', '金龙鱼员工定制版智慧食堂来啦', '结算效率提升、体验提升、时尚智慧餐厅、上线后就餐人数增加，结算效率提升、体验提升、时尚智慧餐厅、上线后就餐人数增加。结算效率提升、体验提升、时尚智慧餐厅、上线后就餐人数增加', '<p><span style=\"font-size:11pt;color:#000000;\">产品：结算台+一卡通+手机支</span><span style=\"color:#000000;font-size:11pt;\">付+在线点餐</span></p><p><span style=\"font-size:11pt;color:#000000;\">好处：结算效率提升、体验提</span><span style=\"color:#000000;font-size:11pt;\">升、时尚智慧餐厅、上线后就</span><span style=\"color:#000000;font-size:11pt;\">餐人数增加</span></p><p style=\"text-align:center;\"><br /></p><div style=\"text-align:center;\"><span style=\"font-size:14.6667px;\"><br /></span></div><p><br /></p>', '/uploads/20200520/35ef71f47deb03748fad4993d01963a4.png', '78', '1585649497', '1589955161', null, '智慧食堂', '', '', '0');
INSERT INTO `wgg_web_cases` VALUES ('15', null, '3', '武汉当代地产', '', '<p><span style=\"font-size: 12pt;\"><font>&nbsp; &nbsp; &nbsp; &nbsp; 武汉当代地产成立于</font>1995年，是一家从事综合性房地产开发，在湖北省具有较大影响力的房企，综合实力在区域性地产界名列前茅，曾荣膺武汉市场房地产行业十大品牌、湖北市场房地产行业十佳信誉品牌、中国房地产品牌企业50强等佳誉。</span></p><p><span style=\"font-size: 12pt;\"><br></span></p><p><span style=\"font-size: 12pt;\"><img alt=\"图片1.png\" src=\"/uploads/20200421/5807146b8108db6cf97ec29f8a214a74.png\" width=\"932\" height=\"554\"><br></span></p><p><span style=\"font-size: 12pt;\"><font><br></font></span></p><p><span style=\"font-size: 12pt;\"><font>&nbsp; &nbsp; &nbsp; &nbsp; 公司采取</font>“独立开发+联合开发+代建”的模式深耕武汉市场，业务覆盖住宅地产、商业地产、产业地产以及小城镇综合体等，所开发的楼盘包括当代国际花园、当代中心、当代卡梅尔小镇、当代安普顿小镇、当代国际城、当代光谷梦工场、当代云谷、当代中德璞誉等二十多个项目，同时，公司稳健布局成都等其它重点城市，实现跨区域发展。</span></p><p><span style=\"font-size: 12pt;\"><br></span></p><p><span style=\"font-size: 12pt;\"><font>&nbsp; &nbsp; &nbsp; &nbsp; 当代地产位于武汉光谷地区的光谷梦工厂项目在对比多家供应商后选择与我司合作，引入戈子科技视觉结算系统等产品，打造智慧餐厅。初期投入</font>4个结算通道产品，智慧餐厅产品的投入在餐厅运营后提升了效率，降低排队，开始陆续吸引更多人来就餐，超过1500人就餐，后来运营方在使用一段时间后进行二次采购。梦工厂园区食堂定位为高端智慧餐厅，装修时尚大方，投入的视觉结算台等产品符合其餐厅定位，成为了光谷地区知名智慧食堂标杆，吸引很多园区及周边白领人员前来就餐，同时也有不少企业客户过来参观。我司在梦工厂餐厅的视觉结算产品的使用口碑，也为我司带来了光谷地区其他客户。</span></p><p><span style=\"font-size: 12pt;\"><br></span></p><p><span style=\"font-size: 12pt;\"><font>&nbsp; &nbsp; &nbsp; &nbsp; 梦工厂打造自选式和特色档口式食堂，给</font></span><span style=\"font-size: 12pt;\"><font>员工</font></span><span style=\"font-size: 12pt;\"><font>自主选择权利，丰俭由人，消费者每天都可以选择不同的菜品，同时配备戈子科技视觉结算</font>6结算通道，实现智能一卡通和手机支付，支持微信订餐和会员管理，大大提升了效率，减少排队，同时在堂食就餐和在线点餐两个途径增加了食堂消费人数和营收，也给消费者和园区</span><span style=\"font-size: 12pt;\"><font>员工</font></span><span style=\"font-size: 12pt;\"><font>更多的体验好感</font></span></p>', '/uploads/20200421/5807146b8108db6cf97ec29f8a214a74.png', '7', '1587454269', '1587534873', '1587534873', '视觉结算台，视觉结算通道', null, null, '0');
