INSERT INTO `wgg_web_config` VALUES ('820', 'seo_info', 'seo_index_description', '首页description', '戈子科技是广州市五宫格信息科技有限责任公司旗下的视觉结算品牌，产品包括智能点餐系统、菜品识别、视觉结算系统等，是全国首家将图像识别技术成功应用于餐饮智能结算并且率先实现商用的品牌。', '1589871926', '1589871926', null);
