INSERT INTO `wgg_web_config` VALUES ('823', 'seo_info', 'seo_solution_description', '解决方案description', '戈子科技智慧食堂解决方案是一套专注满足团餐行业，覆盖餐饮管理全流程的团餐管理信息化解决方案，能够为食堂提供全新的“移动互联”信息化服务，帮助企业摒弃传统餐饮管理弊端，直达运营管理核心，由内而外打造理念超前、技术先进的智慧食堂解决方案。', '1589871926', '1589871926', null);
