INSERT INTO `wgg_web_config` VALUES ('847', 'company_info', 'company_description', '公司简介', '广州市五宫格信息科技有限责任公司是一家集研发、销售、生产和服务于一体的高新技术企业，致力于为团餐行业提供智慧食堂一站式解决方案，旗下拥有“戈子科技”、“五宫格”等品牌。依托人工智能技术、软硬件技术和配套产品服务，融合世界前沿的先进技术理念，戈子科技围绕食堂自选模式、窗口模式、订餐模式，计重消费模式等模式场景流程中研发了戈子视觉结算系统、在线订餐系统、智能支付设备、进销存管理系统、智能称重结算系统等产品。\r\n\r\n目前我司构建了面向全国的经营和服务网络，涵盖政企、医院、高校、交通、能源、金融、电信和企业等行业应用，客户包括苏宁集团、中国农业科学院深圳研究院、济南960医院、华南理工大学、中山大学、金龙鱼、OPPO集团等。', '1589883984', '1589883984', null);
