INSERT INTO `wgg_web_news` VALUES ('7', '1', '比尔盖茨退出微软董事会，20年共捐出538亿美元', '微软公司周五宣布，公司联合创始人兼技术顾问比尔-盖茨（Bill Gates）辞去董事会职务，将更多时间用于慈善事业，其中包括全球健康、发展、教育，以及他在应对气候变化方面越来越多的投入', '微软表示，比尔-盖茨将继续担任首席执行官萨蒂亚-纳德拉（Satya Nadella）和公司其他领导人的技术顾问。\r\n\r\n比尔-盖茨2014年卸任微软董事会主席，但他从2008年开始就将更多时间和精力投入到盖茨基金会，这是世界上最大的慈善机构之一，拥有数十亿美元资产，为抗击疾病和消除贫困的全球卫生项目提供资金。\r\n\r\n', '/uploads/20200316/b0ebabd0b6093132da11f8e924161e6a.jpg', '126', '1584359277', '1585274682', '1585274682', '比尔盖茨，微软', null, null);
INSERT INTO `wgg_web_news` VALUES ('8', '1', '戈子科技进军上海，参与国际酒店用品博览会备受欢迎', '2018年3月26日—29日，戈子科技参与了第二十七届上海国际酒店及餐饮业博览会，并且首次在展会展示了戈子智能视觉收费系统，吸引了不少围观的观众，受到了高度关注。', '<p>&nbsp;&nbsp;&nbsp;&nbsp;2018年3月26日—29日，戈子科技参与了第二十七届上海国际酒店及餐饮业博览会，并且首次在展会展示了戈子智能视觉收费系统，吸引了不少围观的观众，受到了高度关注。</p><p><br /></p><p style=\"text-align:center;\"><img src=\"/uploads/20200513/5d3b0df564594eeafba984d223964486.jpeg\" alt=\"\" width=\"460\" height=\"313\" title=\"\" align=\"\" /></p><p style=\"text-align:center;\"><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;第27届上海国际酒店用品博览会，是全球规模最大、影响力最强、水平最高的博览会之一，2018上海国际酒店及餐饮业博览会历时4天，于3月29日在上海新国际博览中心顺利闭幕，22万余平方米的展示面积，聚集众多顶尖优秀的酒店餐饮界供应商。众多纷至沓来的宾客来自于酒店餐饮业、咖啡、冰淇淋及烘焙行业、酒吧会所、商超零售业等行业，同时更有行业协会嘉宾及来自海内外专业商贸团的莅临参与。在这场堪称国内酒店餐饮业年度采购盛典的舞台上上演了集竞赛、展示、研讨及贸易配对等多重精彩纷呈的好戏，为国内及甚至国际酒店餐饮行业的蓬勃发展做出了不可估量的促进作用。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;本届展会广州五宫格信息科技责任有限公司展出最新款式的<strong>戈子视觉结算系统</strong>，吸引了不少观众的关注。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;戈子科技与战略合作伙伴共同上海参展，在会展当天吸引了许多参展人员前来围观。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;在会展上，戈子视觉结算系统作为一个新鲜的高科技产品出现在会展现场。作为全国首款商业化餐饮视觉智能结算系统，颇引人注目。很多参会人员前来亲身体验戈子视觉识别系统，不用芯片依靠图像识别的人工智能新技术进行结算的黑科技，给大家带来了不一样的新鲜体验并且对此给予了一致好评。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;戈子智能结算台由于其与互联网，大数据，人工智能等如今的热点紧密结合，并且具有采用视觉结算、不加芯片等新颖特性和优势，引来了参展人员前来体验和咨询，大家对新技术，新科技的热情度很高。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;在展会也有不少依靠芯片进行感应识别的智能结算台，但是戈子视觉结算系统依靠其“不加芯片，视觉智能结算”的特点和新颖性，受到很多观众的关注和咨询。</p><p><br /></p><p><strong>&nbsp;“戈子视觉结算系统”，是一款将图像信息处理技术应用到团膳领域结算服务的产品，实现餐饮智能视觉结算功能。</strong>戈子科技这一品牌主要提供以戈子视觉结算系统为主的一系列针对餐饮智能结算及相关领域的解决方案，是全国首家将图像识别技术成功应用于餐饮智能视觉结算并且率先实现商用的品牌，并且获得了业内的普遍认可和社会广泛关注。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;一套戈子视觉结算系统一分钟可以完成十个人的消费结算，并且把数据同步到后台云端，戈子视觉结算系统进行了大量的细节设计，确保整个结算流程无差错。杜绝传统人工错误，无重复结算。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;“戈子视觉结算系统”不仅能为消费者提供快速、精确的结算支付体验，同时还拥有低成本、低损耗的优势，为团膳企业节省了可观的运营费用，对团膳领域的互联网化提供了数据基础，是团膳领域进行改造升级的新途径。戈子视觉结算系统，还能对识别结算中采集的菜品和消费数据等进行菜品识别和数据分析，为个人消费者提供消费数据服务和健康饮食数据服务。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;戈子科技在已经做到餐具识别快、准、稳的情况下，不断创新与突破，研发菜品识别，打造更稳定更高端的视觉结算系统。</p><p><br /></p><p>每次消费记录快速上传至云端，饭堂管理者可随时查询分析，实时获取饭堂经营状况，用数据事实来改进菜品与采购方案。不仅如此，还利用智能结算系统在后台修改程序，推行打折，满减等优惠活动，在原有的优势上吸引留住更多消费者，削弱外面餐馆与外卖的威胁。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;同时，戈子视觉收费系统通过采集用户就餐数据，对大数据进行分析处理，得出就餐者卡路里与营养摄入情况，加强了高校，企业对员工的饮食关怀，解决了就餐者饮食不健康、饮食搭配不科学的问题，数据经过分析处理后送到消费者手里，更加科学地做到合理、健康的饮食消费。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;戈子科技产品成功于上海某单位园区食堂落地，打进魔都第一枪。并且即将在其他区域大规模铺开市场，敬请关注和支持。</p>', '/uploads/20200330/01356f5d9ed4c516eb0d9bbb8f230bc7.jpg', '280', '1584359349', '1590031320', null, '戈子科技，视觉结算系统', '戈子科技进军上海，参与国际酒店用品博览会备受欢迎', '戈子科技进军上海，参与国际酒店用品博览会备受欢迎');
INSERT INTO `wgg_web_news` VALUES ('9', '1', '戈子科技参加第三届广东团餐产业发展大会受到高度关注', '2018年1月20号，五宫格作为会员单位出席第三届广东团餐产业发展大会，展示戈子智能视觉收费系统，受到了许多企业会员与嘉宾的关注与高度评价。', '<p>&nbsp;&nbsp;&nbsp;&nbsp;2018年1月20号，五宫格作为会员单位出席第三届广东团餐产业发展大会，展示戈子智能视觉收费系统，受到了许多企业会员与嘉宾的关注与高度评价。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;戈子科技在本次大会展览中吸引了不少参与人员前来体验和咨询，我们展示了团餐行业的新科技产品——戈子视觉结算系统。本次展览共有四家智能识别结算参与展览，其中有两家利用芯片识别技术进行智能结算。戈子视觉结算凭借不加芯片、全国首家视觉智能结算商用、稳定性强等特点，备受欢迎和关注。</p><p><br /></p><p style=\"text-align:center;\"><img src=\"/uploads/20200513/868ea42f6473884e6ad357749dc443b0.jpg\" alt=\"戈子科技参加第三届广东团餐产业发展大会受到高度关注\" width=\"460\" height=\"258\" title=\"戈子科技参加第三届广东团餐产业发展大会受到高度关注\" align=\"\" /></p><p style=\"text-align:center;\"><br /></p><p>一套戈子视觉结算系统一分钟可以完成十个人的消费结算，并且把数据同步到后台云端，戈子视觉结算系统进行了大量的细节设计，确保整个结算流程无差错。杜绝传统人工错误，无重复结算。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;戈子科技在已经做到餐具识别快、准、稳的情况下，不断创新与突破，研发菜品识别，打造更稳定更高端的视觉结算系统。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;每次消费记录快速上传至云端，饭堂管理者可随时查询分析，实时获取饭堂经营状况，用数据事实来改进菜品与采购方案。不仅如此，还利用智能结算系统在后台修改程序，推行打折，满减等优惠活动，在原有的优势上吸引留住更多消费者，削弱外面餐馆与外卖的威胁。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;同时，戈子视觉收费系统通过采集用户就餐数据，对大数据进行分析处理，得出就餐者卡路里与营养摄入情况，加强了高校，企业对员工的饮食关怀，解决了就餐者饮食不健康、饮食搭配不科学的问题，数据经过分析处理后送到消费者手里，更加科学地做到合理、健康的饮食消费。</p><p><br /></p><p>与此同时，在餐厅中还摆放着一台戈子智能结算台。中午用餐时，许多参会者前来亲身体验戈子视觉识别系统，不用芯片依靠图像识别的人工智能新技术进行结算的黑科技，给大家带来了不一样的新鲜体验并且对此给予了一致好评。</p><p><br /></p><p style=\"text-align:center;\"><img src=\"/uploads/20200513/3c915367b9c799d5bd856f8654de2b49.jpg\" alt=\"\" width=\"460\" height=\"345\" title=\"\" align=\"\" /></p><p style=\"text-align:center;\"><br /></p><p>下午分享嘉宾中膳国际团餐产业联盟理事长李力强给戈子智能结算系统给予了极高的评价，他以“团餐+产业联盟——团餐人抱团出海走江湖”为主题，深入浅出地说明了团餐行业需要抱团创新，并且鼓励团餐业融入黑科技和年轻活力，对我们产品给予极大支持，参会人员也更加深入了解了我们。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;理事长李力强对在分享过程中深入介绍了戈子智能收费系统，包括戈子视觉收费系统与人工相对比的优势，与目前市面上使用较多的芯片对比的优势与创新，大数据的收集与利用的重要性以及戈子视觉收费系统如何实现成本节约与盈利上涨。同时提出，目前市面上以芯片技术为主的智能结算台已经满足不了更高更多更稳定的需求，如今是一个人工智能的时代，图像识别是人工智能的一个重要分支，所以视觉识别结算台将会是一个全新且充满活力的方向，团餐行业十分需要也非常欢迎像戈子科技这种黑科技进入，为整个行业注入更多新鲜的血液。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;经过详细具体的介绍后，戈子科技给参会人员留下了深刻的印象。更重要的是，在如今需要不断创新，不断改革的时代，团餐行业在面对新的挑战和机遇时需要有新技术新智能，才能够更好地跟上人工智能时代的潮流。</p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;从2017年五宫格全国首创视觉识别系统，团餐协会到现场实地考察访问，到2018年的第一个月五宫格获得了2017年度广东省团餐行业优秀供应商奖，应当感谢团餐广东协会和一路上遇到给我们帮助的人，我们必将不忘初心，砥砺前行，为行业提供更加优质的产品和服务。</p>', '/uploads/20200330/e8e1e8c1915c70b3ff3df537e5e38701.jpg', '410', '1584359412', '1589860425', null, '戈子科技', '戈子科技参加第三届广东团餐产业发展大会受到高度关注', '戈子科技参加第三届广东团餐产业发展大会受到高度关注');
INSERT INTO `wgg_web_news` VALUES ('10', '1', '戈子科技参与广州酒店用品展览会备受欢迎！', '第25届广州酒店用品展览会，参展企业3000多家，3天展期共有专业观众买家40万人次进入展馆参观采购。是全球规模至大、参观人数最多的酒店用品展览会之一。今期展览覆盖整个中国进出口商品交易会展馆，预计面 积超过27万平方米，届时我们将携手数千家参展商欢迎来自国内外酒店、餐饮及相关行业的专业观众买家莅临参观洽谈。', '<p>&nbsp;&nbsp;&nbsp;&nbsp;第25届广州酒店用品展览会，参展企业3000多家，3天展期共有专业观众买家40万人次进入展馆参观采购。是全球规模至大、参观人数最多的酒店用品展览会之一。今期展览覆盖整个中国进出口商品交易会展馆，预计面 积超过27万平方米，届时我们将携手数千家参展商欢迎来自国内外酒店、餐饮及相关行业的专业观众买家莅临参观洽谈。</p><p><br /></p><p style=\"text-align:center;\"><img src=\"https://www.wggai.com/bikibb/news/news2/1.jpg\" alt=\"\" width=\"460\" height=\"182\" title=\"\" align=\"\" /></p><p style=\"text-align:center;\"><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;本届展会广州五宫格信息科技责任有限公司展出最新款式的戈子视觉结算系统，这个食堂黑科技成为了展会一大亮点。在会展上，戈子视觉结算系统作为一个新鲜的高科技产品出现在会展现场。作为全国首款商业化餐饮视觉智能结算系统，颇引人注目。</p><p><br /></p><p style=\"text-align:center;\"><img src=\"https://www.wggai.com/bikibb/news/news2/2.jpg\" alt=\"\" width=\"460\" height=\"182\" title=\"\" align=\"\" /></p><p><br /></p><p>&nbsp;&nbsp;&nbsp;&nbsp;智能结算台由于其与互联网，大数据，人工智能等如今的热点紧密结合，引来了十分多参展人员前来体验和咨询，大家对新技术，新科技的热情度很高。</p>', '/uploads/20200330/3be3ddd83fbc81d6a6819a19272fd9f1.bmp', '91', '1585121548', '1589772176', null, '戈子科技，智慧食堂，智能黑科技', '戈子科技参与广州酒店用品展览会备受欢迎！', '戈子科技参与广州酒店用品展览会备受欢迎！');
