INSERT INTO `wgg_web_product` VALUES ('14', '10', '自助称重选餐台', '', '/uploads/20200330/566b15cbafcd7880d05959dac447d497.png', '/uploads/20200518/9d0fdffa1a6fe37eac6bd58f40cf59b7.png', '/uploads/20200426/3a63b3a9edcd909237573c266b3f624d.png', '型号：ZZCZ-202052：|尺寸：8英寸，全视角LCD；|功能：1.3克起跳，精确到克；\r\n2.人脸动态检测验证，防误识；\r\n3.一体化天线，更易融入餐厅设计；\r\n4.取餐营养、能量在线动态提醒；', '自助称重选餐台：1.无感支付：实时感应菜盆重量变化，精准计算取餐重量及消费金额；\r\n2.空中支付：取餐完成，自动生成就餐记录同步至服务器，进行空中结算；3.声光报警：针对“未放置感应区”“过敏原”等操作，联动发出声光提示。', '', '1585552506', '1589871192', null, '自助称重选餐台，称重选餐台，无感称重，无感称重系统', '自助称重选餐台-戈子科技', '自助称重选餐台：1.无感支付：实时感应菜盆重量变化，精准计算取餐重量及消费金额； 2.空中支付：取餐完成，自动生成就餐记录同步至服务器，进行空中结算。');
