INSERT INTO `wgg_web_product` VALUES ('16', '11', '智能备餐台', '', '/uploads/20200330/6b9795841283bd9702c300c9f48624fd.png', '/uploads/20200518/9d0fdffa1a6fe37eac6bd58f40cf59b7.png', '/uploads/20200426/3a63b3a9edcd909237573c266b3f624d.png', '型号：BCT-2020515；|尺寸：300*90*50cm；|功能：智能保温备餐，显示餐品名称营养，价格等信息。', '智能备餐台：1.根据感应进入读写区域的托盘和菜盆打菜前后的重量变化，计算出取菜菜品重量，实现智能称重计量；2.顾客根据自己所需和份量自主选菜，称重计费，大大减少食材浪费率；3.支持一卡通在线充值，支持一卡通余额不足时使用微信、支付宝、网银等在线支付当前餐费。', '', '1585552572', '1589871203', null, '智能备餐台，智能配件，智能配套硬件，智能备餐台', '智能备餐台-戈子科技', '智能备餐台：1.根据感应进入读写区域的托盘和菜盆打菜前后的重量变化，计算出取菜菜品重量，实现智能称重计量；2.顾客根据自己所需和份量自主选菜，称重计费，大大减少食材浪费率。');
