INSERT INTO `wgg_web_product` VALUES ('19', '9', '双屏收银人脸终端', '', '/uploads/20200330/b596a3f655181f9f7b80bd55e56381cb.png', '/uploads/20200518/7de9c318b6fac2f966bb9c446ef63a9f.jpg', '/uploads/20200518/820a514100f94c4e2665a2c5ca93e0a9.jpg', '型号：SPSY-202002；|尺寸：15.6寸；|功能：主要用于档口点餐，员工在双屏设备上自助点餐，提交订单，使用微信/支付宝/虚拟卡二维码扫描，或直接刷饭卡完成支付，显示并语音提示菜品和扣费信息。', '双屏收银人脸终端：1.具有良好的散热系统，根据空气动力学原理设计散热方案，以动力散热为主方案，自然散热为辅，有效带走热量，无需担心散热不良；2.晶屏采用LED高清液晶屏、亮度更高、色彩更丰富、高触感屏防水设计，一键开机设计简洁；3.配套设备还包括小票打印机、扫描枪等设备。', '', '1585553707', '1589871269', null, '双屏收银人脸终端，双屏收银及配套', '双屏收银人脸终端-戈子科技', '双屏收银人脸终端：1.具有良好的散热系统，根据空气动力学原理设计散热方案，以动力散热为主方案，自然散热为辅，有效带走热量，无需担心散热不良；2.晶屏采用LED高清液晶屏、亮度更高、色彩更丰富、高触感屏防水设计，一键开机设计简洁。');
INSERT INTO `wgg_web_product` VALUES ('20', '11', '人脸识别终端', '', '/uploads/20200330/78b63ed6017c1442c22dc16e879aabe7.png', '/uploads/20200518/9d0fdffa1a6fe37eac6bd58f40cf59b7.png', '/uploads/20200518/28e3c11a047ba84ac7074e86dc921f8c.jpg', '型号：RLS-202071；|寸尺：23cm*11.6cm*2cm；|功能：支持小程序，人脸终端，批量后台人脸采集；支持刷脸计次，刷脸固定金额消费；限制外来人员消费；人员类型分类扣费等多种刷脸扣费模式。', '人脸识别终端:1.支持人脸识别或陌生人检测时的现场照片保存；2.支持屏幕显示内容配置，支持识别距离配置；3.支持刷卡语音播报消费金额，音量提高十倍，0-15范围任意调节；4.领先的数据存储算法，支持数据循环存储、数据恢复，数据安全更有保障。', '', '1585554120', '1589871282', null, '人脸识别终端，人脸识别，人脸识别技术', '人脸识别终端戈子科技', '人脸识别终端:1.支持人脸识别或陌生人检测时的现场照片保存；2.支持屏幕显示内容配置，支持识别距离配置；3.支持刷卡语音播报消费金额，音量提高十倍，0-15范围任意调节。');
INSERT INTO `wgg_web_product` VALUES ('21', '11', '人脸识别通道', '', '/uploads/20200330/2fb1350c07c75931423acb35392f91c4.png', '/uploads/20200518/9d0fdffa1a6fe37eac6bd58f40cf59b7.png', '/uploads/20200518/28e3c11a047ba84ac7074e86dc921f8c.jpg', '型号：RLSB-202015；|尺寸：1200mm×280mm×980mm；|功能：表面原厂拉丝，断电自动掉杆；通道宽：≤550mm，红外防夹保护，非法闯入红外报警；开闸信号输入：干接点，刷卡开闸反向逆行报警；', '人脸识别通道：1.主要功能人员身份识别功能；2.视频联动功能；3.防止尾随功能；4.防止代刷卡功能；5.支持“反潜入“功能；6.实时监控功能。\r\n', '', '1585554137', '1589871006', null, '人脸识别通道，人脸识别双通道，人脸识别单通道', '人脸识别通道-戈子科技', '人脸识别通道：1.主要功能人员身份识别功能；2.视频联动功能；3.防止尾随功能；4.防止代刷卡功能；5.支持“反潜入“功能；6.实时监控功能。');
INSERT INTO `wgg_web_product` VALUES ('22', '11', '智能托盘机', '', '/uploads/20200330/2c6d27c34fa79c9465216fbac5021589.png', '/uploads/20200518/9d0fdffa1a6fe37eac6bd58f40cf59b7.png', '/uploads/20200518/28e3c11a047ba84ac7074e86dc921f8c.jpg', '型号：ZDTP-20206；|尺寸：L500mm×W450mm×H1600mm；|功能：智能数控，精准定点出餐；超长续航能力，自动出餐，自动停止；远程控制功能', '智能托盘机：1.智能数控，精准定点出餐；2.超长续航能力，自动出餐，自动停止；3.远程控制功能。', '', '1585554156', '1589871048', null, '智能托盘机，智能托盘，智盘', '智能托盘机-戈子科技', '智能托盘机：1.智能数控，精准定点出餐；2.超长续航能力，自动出餐，自动停止；3.远程控制功能。');
INSERT INTO `wgg_web_product` VALUES ('23', '11', '刷卡机', '', '/uploads/20200330/695a28f3a57b6ca22a6849e575304038.png', '/uploads/20200518/9d0fdffa1a6fe37eac6bd58f40cf59b7.png', '/uploads/20200518/28e3c11a047ba84ac7074e86dc921f8c.jpg', '型号：SK-202001;|        尺寸：L283.8*W190.6*H106mm；|        功能：全新的主板设计，硬件、软件看门狗，双重防护，杜绝死机，让设备运行更稳定，设备设计有较强的防油、防污、防水能力； ', '刷卡机：1.高强度硅胶按键设计，手感好，寿命长；2.实现实时通讯功能，使数据实时存储到数据库中，以便及时查询数据；3.支持云卡通消费，微信支付宝二维码消费；4.支持扩展TCP/IP通讯，433无线通讯，WIFI通讯，GPRS通讯。', '', '1585554175', '1589871083', null, '刷卡机，实时结算，刷卡POS机', '刷卡机-戈子科技', '刷卡机：1.高强度硅胶按键设计，手感好，寿命长；2.实现实时通讯功能，使数据实时存储到数据库中，以便及时查询数据；3.支持云卡通消费，微信支付宝二维码消费。');
INSERT INTO `wgg_web_product` VALUES ('24', '11', '自助消费终端', '', '/uploads/20200330/827a474f050ee0351d8f6b88729046a4.png', '/uploads/20200518/9d0fdffa1a6fe37eac6bd58f40cf59b7.png', '/uploads/20200518/28e3c11a047ba84ac7074e86dc921f8c.jpg', '型号：GZ-ZZXF001；|      尺寸：L500mm×W450mm×H1600mm； |     功能：自助发卡、自助补卡、打印小票、自助挂失、补助领取、余额查询、充值查询、消费查询、自助订餐、水控转账、电控缴费、第三方接口查询对接功能等（部分功能需选配）；', '自助消费终端：1.全钢制结构，内含恒温稳压电源控制系统，音响和功放技术，网络接口；2.支持微信，支付宝充值，支持查询个人消费情况，支持自助订餐功能。', '<p><br /></p><p><br /></p>', '1585554194', '1589871123', null, '自助消费终端，自助消费，智能结算', '自助消费终端-戈子科技', '自助消费终端：1.全钢制结构，内含恒温稳压电源控制系统，音响和功放技术，网络接口；2.支持微信，支付宝充值，支持查询个人消费情况，支持自助订餐功能。');
INSERT INTO `wgg_web_productcategory` VALUES ('8', '视觉结算系统', '/uploads/20200518/a0466619c283a7edca85c04225f493d3.png', '/uploads/20200518/b816eb071b961494d39232109201eb79.png', '/uploads/20200518/1a1927a209412b6891fbd929b2560f88.png', '/uploads/20200518/38a04994b4148f86a75c3fac3b65e3fc.jpg', 'AI智能结算|餐具，菜品识别|人脸识别支付|节省人力成本|无需定制餐具|1S识别，提升效率', 'Ai智能结算，菜品识别Ai智能结算，菜品识别', '1584415873', '1589861004', null, 'AI视觉结算，视觉结算系统,智能支付设备,线上支付系统,后台管理系统', '视觉结算系统-智慧食堂管理系统-戈子科技', '戈子科技主营智能结算系统等系列智能食堂视觉结算设备，如利用图像识别等技术，不加芯片的“智盘”，为团膳企业节约成本，提升效率以及食堂竞标方案成功率。提供智慧结算系统,智慧食堂智能管理系统一体化解决方案.');
INSERT INTO `wgg_web_productcategory` VALUES ('9', '在线订餐系统', '/uploads/20200518/08f3b5815cd917a2b3bba2c549478b22.png', '/uploads/20200518/fb62e4ff1639d97fb26dfd602cf98d52.png', '/uploads/20200518/1a1927a209412b6891fbd929b2560f88.png', '/uploads/20200518/820a514100f94c4e2665a2c5ca93e0a9.jpg', '提前预定，在线点餐|配送管理|在线充值|营养分析|消费记录查询|智能取餐|菜品及菜谱管理', '微信预定，在线点餐|配送管理|在线充值', '1584416074', '1589852213', null, '微信预定，在线点餐系统，智能配送，线上订餐，在线订餐系统', '无感称重系统-团餐智慧食堂管理系统-戈子科技', '戈子科技是围绕食堂自选模式、窗口模式、订餐模式中结算、支付、订餐、取餐、运营管理、采购管理等流程研发了相关产品，目前有戈子视觉结算系统、智能订餐、智能支付、进销存管理等产品。');
INSERT INTO `wgg_web_productcategory` VALUES ('10', '无感称重系统', '/uploads/20200518/837543588e04b9ad1f40e9e23d243206.png', '/uploads/20200518/b67b03d54ca1626f149e9b3417489fad.png', '/uploads/20200518/1a1927a209412b6891fbd929b2560f88.png', '/uploads/20200518/28680320f05d0df04a367da16db7100f.jpg', '一菜一价|自助选餐体验|降低人力成本|智能称重计算|无感支付|多维度数据运营分析', '一菜一价|自助选参体验|促进光盘行动|精细运营管理|降低人力成本|智能称重计算|无感支付|多维度数据运营分析', '1584416246', '1589852154', null, '无感称重,智能称重结算,无感称重技术,戈子科技,无感支付技术', '无感称重系统-团餐智慧食堂管理系统-戈子科技', '广州戈子信息科技公司自主研发，自有知识产权的智能结算台，智能取餐柜。提供智慧结算系统，智慧食堂智能管理系统一体化解决方案.');
