INSERT INTO `wgg_web_solution` VALUES ('12', '智慧食堂', '', '', '/uploads/20200518/10c5787d9d09a84296b0aa934940f5ab.jpg', '/uploads/20200518/8f8904d144c13f05327fef24a2e7f40c.jpg', '戈子科技智慧食堂解决方案是一套专注满足团餐行业，覆盖餐饮管理全流程的团餐管理信息化解决方案，能够为食堂提供全新的“移动互联”信息化服务，帮助企业摒弃传统餐饮管理弊端，直达运营管理核心，由内而外打造理念超前、技术先进的智慧食堂解决方案。', '<p><span style=\"color: rgb(99, 99, 99); font-size: 16px;\">“戈子科技智慧食堂”方案是一套专注满足团餐行业，覆盖餐饮管理全流程的团餐管理信息化解决方案，能够为食堂提供全新的“移动互联”信息化服务，帮助企业摒弃传统餐饮管理弊端，直达运营管理核心，由内而外打造理念超前、技术先进的智慧食堂解决方案。&nbsp;</span></p><p><span style=\"color: rgb(99, 99, 99); font-size: 16px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;解决方案分为“订餐管理” 、“就餐管理” 、“食堂管理” 、 “企业监管” 四个模块，细分为在线订餐、智能支付、视觉结算、后台管理、企业管控等方面，同时可以配套提供餐具、定制化开发等一系列配套产品和服务，全面满足企业管控，食堂运营，职工就餐的多元化，定制化需求。</span></p>', '智慧食堂', '1584418333', '1589771164', null, '智慧食堂解决方案,戈子智慧食堂,智慧食堂方案,戈子科技', '智慧食堂-团餐智慧食堂解决方案-戈子科技', '广州戈子信息科技公司自主研发,自有知识产权的智能结算台,智能取餐柜.提供智慧结算系统,智慧食堂智能管理系统一体化解决方案.');
INSERT INTO `wgg_web_solution` VALUES ('13', '自选餐', '', '', '/uploads/20200518/10c5787d9d09a84296b0aa934940f5ab.jpg', '/uploads/20200518/5f318ffe4b81e0443241bc8ac309e6bc.jpg', '戈子科技是围绕食堂自选模式、窗口模式、订餐模式中结算、支付、订餐、取餐、运营管理、采购管理等流程研发了相关产品，目前有戈子视觉结算系统、智能订餐、智能支付、进销存管理等产品。', '戈子科技是围绕食堂自选模式、窗口模式、订餐模式中结算、支付、订餐、取餐、运营管理、采购管理等流程研发了相关产品，目前有戈子视觉结算系统、智能订餐、智能支付、进销存管理等产品。', '自选餐', '1584418333', '1589771147', null, '自选餐，智能结算方案，智能取餐,智能收费,餐厅智能系统', '自选餐-团餐智慧食堂管理系统-戈子科技', '戈子科技是围绕食堂自选模式、窗口模式、订餐模式中结算、支付、订餐、取餐、运营管理、采购管理等流程研发了相关产品，目前有戈子视觉结算系统、智能订餐、智能支付、进销存管理等产品。');
